  b 02.12.1955
  b 14.02.1951
  Susan b. at Hastings and m. at Pukehou. Divorced 1992. Susan has always been known by her maiden
  name. Ian, s/o Frank and Margaret Willis, United Kingdom. Address: 38 Codrington Crescent,
  Mission Bay, Auckland.
  Susan attended Woodford House, Havelock North, spending her final year at Stanborough Comprehensive
  School in North London, England as a Rotary Exchange Student. She attended Massey University then
  transferred to Canterbury University where she completed a BA in English. She then gained a
  Post-Graduate Diploma of Journalism from Canterbury University.
  Susan has worked in corporate communications and marketing for the past ten years, most recently
  being the Chief Executive of The New Zealand Way, a branding campaign for New Zealand companies in
  the industrial marketplace. She has worked as a consultant in Wellington and worked variously in
  Auckland.
